/* Include files */
#include "exprincl.h"

#include "exprpriv.h"
#include "../defaults.h"

/* Macro for adding a function node type */
#define EXPR_ADDFUNC_TYPE(name, returnerType, function, realFunction, mp_ctrl, argmin, argmax, refmin, refmax) \
err = exprFuncListAdd(flist, name, returnerType, function, realFunction, mp_ctrl, argmin, argmax, refmin, refmax); \
if(err != EXPR_ERROR_NOERROR) \
    return err;

/* Macro for adding a constant */
#define EXPR_ADDCONST(name, val) \
err = exprValListAdd(vlist, name, val); \
if(err != EXPR_ERROR_NOERROR) \
    return err;


